import { Link } from "react-router-dom";
import { useSelector } from "react-redux";
import Breadcrums from "../components/Breadcrumbs";
import { ProductState } from "../redux/reducer";

const CartPage = () => {
  const state = useSelector((state: ProductState) => state.cart);
  return (
    <>
      <Breadcrums title="Корзина" />
      {state.length > 0 ? (
        1
      ) : (
        <div className="empty inner__content">
          <div className="shop-cart-empty text-center">
            Пусто
            <div>
              <Link className="cart_btn" to="/catalog">
                Продолжить покупки
              </Link>
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default CartPage;
